import React from "react";
import { useState, useEffect } from "react";
import Item from "../../Molecules/Item/Item";

const List = ({Itemlist}) =>{

    const [list, setList] = useState("")
    
    return(
        <ul>
            {()=>{
                if (list != Itemlist) {
                    setList(Itemlist)
                }else{
                    setList(Itemlist)
                    list.map(content => <li><Item text={content.text}/></li>)
                }
            }}
        </ul>
    )
}

export default List
